import {Box, Stack, Typography} from '@mui/material'

const Header = () => {
  return (
    <div style={{left: '15%', backgroundColor: 'white', position: 'absolute', width: '100%', height: '50px', borderBottom: '2px solid black'}}>
      <div style={{backgroundColor: '#D3D3D3', border: '2px solid black', marginTop: '0px', marginLeft: '20px', marginRight: '20px', width: '81%', height: '100px'}}>

      </div>
    </div>
  )
}

export default Header
